## Homework Assignments

Each homework assignment is worth 10 points, and require your **"best honest effort"**, which includes contacting me if you need help. Please do not turn in partial work. Instead, please ask for help! For the homework assignments, if you are stuck for more than 10-15 minutes, reach out for help. Don't spend any more than 15 minutes before reaching out. You can ask your classmates, the internet, or me! <br> <br>



